import React, { Component } from "react";
import Paper from '@material-ui/core/Paper';
import InputBase from '@material-ui/core/InputBase';


class Searchbox extends Component {

  render() {

    var sList = [
      {width:"100%", background:"#eee", "padding":"20px"},
      {width:"100%", background:"#eee"}
    ];
    return (
        <div className="leftblock" style={sList[0]}>
          <div className="leftblock" style={sList[1]}>
            BioMuta - single-nucleotide variations (SNVs) in cancer	
          </div>
          <div className="leftblock">
            <input type="text" className="form-control" defaultValue="P01116"/>      
            <button type="button" className="btn btn-secondary">Search</button>
          </div>
        </div>
    );
  }
}

export default Searchbox;
